import React from 'react';
import Humanitarian from '../../assets/humanitarian.svg';

const HumanitarianComponent = () => (
  <div className="Humanitarian-Component">
    <img src={Humanitarian} className="humanitarian" alt="humanitarian" />
  </div>
);

export default HumanitarianComponent;
